import React, { useState } from "react";
import "./App.css";
import Search from "./components/search/Search";
import axios from "axios";
import cors from "cors";

const App = () => {
  const [temp, setTemp] = useState([]);

  const [city, setCity] = useState(null);

  const searchCity = (city) => {
    fetch(
      `https://api.weatherbit.io/v2.0/forecast/daily?city=${city},AR&key=46393c9cae6042c89b25a9d168fd6532`
    )
      .then((r) => r.json())
      .then((recurso) => {
        console.log(recurso);
      });
  };

  return (
    <div>
      <Search city={city} searchCity={searchCity} />
    </div>
  );
};

export default App;
